To debug backend applications, the SDK provides There are a few debugging capabilities for Wasm program. The Fluence network provides a possibility to so-called print-debugging. It can be included by specifying the wasm_logger feature of the sdk. The logger is implemented as a logging facade for crate log . It means that all log crate possibilities can be used as usual. Let's review it by the example of hello-world2 application with simple logging: use fluence::sdk::*;
use log::info; fn init() { logger::WasmLogger::init_with_level(log::Level::Info).is_ok()
} #[invocation_handler(init_fn = init)]
fn main(name: String) -> String { info!("{} has been successfully greeted", name); format!("Hello from Fluence to {}", name)
} The easiest way to initialize the logger is using the init_fn attribute of invocation_handler like in the example above. Please also note that this logger is designed only for Wasm environment and Fluence WasmVm . Don't use it for other targets and virtual machines. But if it needs to create a project with logger either for Wasm target and other architectures, a conditional compilation can be used: fn init() { if cfg!(target_arch = "wasm32") { logger::WasmLogger::init_with_level(log::Level::Info).unwrap(); } else { simple_logger::init_with_level(log::Level::Info).unwrap(); }
} Without this trick app that uses the logger can be compiled only for wasm32-unknown-unknown target. It is also important to note that by default debugging capabilities is disabled in the Fluence network because of verification game process (you can find more information about it in our paper ). -->

