Fluence does not provide a sane request routing yet – only one function can be marked as an entry point. This means that each developer has to independently decide on an input argument format, parse this argument in the entry point function, and call other functions based on the passed action selector. One option would be to use JSON serialization (for example, provided by serde and serde_json crates) to wrap input data. Once the input is parsed, the code in the entry point function can perform manual routing: use fluence::sdk::*; use serde_json::{json, Value};
use serde::{Deserialize, Serialize}; #[derive(Serialize, Deserialize)]
pub struct Request { pub action: String, pub player_name: String,
} #[invocation_handler]
fn handle_request(req: String) -> String { let value: Value = serde_json::from_str(req.as_str())?; let request: Request = serde_json::from_value(value.clone())?; match request.action.as_str() { "create_game" => { // create a new game } ... "move" => { // make a player's move } }
}

