A backend application is allowed to consist of more than one WebAssembly module (provided they have different names), but only one of those modules can be called by the state machine. Note that this module should not have the module name section. Additionally, every backend application that is going to be deployed to the Fluence network is expected to export three functions – invoke() , allocate() , and deallocate() : #[no_mangle]
pub unsafe fn invoke(ptr: *mut u8, len: usize) -> usize { ...
} #[no_mangle]
pub unsafe fn allocate(size: usize) -> NonNull<u8> { ...
} #[no_mangle]
pub unsafe fn deallocate(ptr: *mut u8, size: usize) { ...
} Note that #[no_mangle] and pub unsafe signature parts force these functions to be exported by WebAssembly (refer to this discussion for more info). In wast format, these functions are expected to have the following signatures: (func (export "invoke") (param $buffer i32) (param $size i32) (result i32)) (func (export "allocate") (param $size i32) (result i32)) (func (export "deallocate") (param $address i32) (param $size i32) (return)) The invoke() function is the main entry point to the deployed application. It takes two i32 params – a pointer to the byte array stored in the WebAssembly memory and the byte array size. If the state machine needs to call the invoke() function with no arguments, it passes two null values for the pointer and the size argument. To return the result, the invoke() function returns a pointer to the WebAssembly memory region where the first 4 bytes represent the size of the result buffer, and the next size bytes represent the result buffer itself. The allocate() function is responsible for allocating a region of memory where the state machine can write the data which should be passed to the application. Once the region is allocated, the application should not overwrite it until a corresponding deallocate() call is made. The allocate() function takes an i32 parameter which specifies the size of the region, and returns a pointer to the allocated region in the WebAssembly memory. The deallocate() function is responsible for memory deallocation. It takes two i32 arguments – the address of the memory region that should be deallocated and its size.

